        ans.innerText = "perf. " + perf + '\n' + "-> " + nov + " (" + op + d + ")"
        pdata[0].innerText = ' and gained ' + op + d + ' rating points taking place ' + tr;
        var col = document.getElementsByClassName("name");
        var nrat = [0, 1200, 1400, 1700, 1900, 2100, 2300, 2400, 2600, 3000]
        var hcol = ['#808080', '#008000', '#03a89e', '#0000ff', '#aa00aa', '#ff8c00', '#ff8c00', '#ff0000', '#ff0000', '#ff0000']
        var p = -1;
        for (var i = 0; i < nrat.length; i++)
            if (nov >= nrat[i]) p = i;
        col[0].style.color = hcol[p];
    }
</script>
